import * as React from "react";
import { Link } from "react-router-dom";
import Grid from "@mui/material/Grid";
import Button from "@mui/material/Button";
import Toolbar from "@mui/material/Toolbar";
import CssBaseline from "@mui/material/CssBaseline";
import headerImg from "../../../img/header-img.png";
import headerLogo from "../../../img/header-logo.png";
import About from "./About";
import "./home.css";
import Team from "./Team";

export default function Home() {
  return (
    <>
        <div style={{backgroundColor:"#e0eff5"}}>

      <React.Fragment>
        <CssBaseline />
        <Toolbar id="back-to-top-anchor" />

        <Grid container spacing={2} sx={{ marginTop: "100px", backgroundColor:"#e0eff5" }}>
          <Grid xs={6}>
            <img src={headerLogo} alt="" className="header-logo"></img>
            <h3 className="header-h3">
              Quickly and Easily Discover Developers Like You, Connect With Your
              Ideal Teammates and Coding Better Together.
            </h3>
            <Button
              type="submit"
              variant="contained"
              underline="none"
              sx={{
                ":hover": {
                  bgcolor: "#e4a300",
                },
                mt: 3,
                mb: 2,
                backgroundColor: "#FFB703",
                marginLeft: "200px",
              }}
            >
              <Link
                to="/signup"
                style={{ color: "white", textDecoration: "none" }}
              >
                Sign up
              </Link>
            </Button>
            <Button
              type="submit"
              variant="contained"
              sx={{
                mt: 3,
                mb: 2,
                marginLeft: "15px",
                backgroundColor: "#00468B",
                ":hover": {
                  bgcolor: "#00366b",
                },
              }}
              onClick={() => {}}
            >
              <a
                href="#about"
                style={{ color: "white", textDecoration: "none" }}
              >
                What is Devteams
              </a>
            </Button>
            <p className="header-p">
              Already a member?
              <Link to="/signin" className="header-link">
                Log in here
              </Link>
            </p>
          </Grid>

          <Grid xs={6}>
            <img src={headerImg} alt="" className="header-img"></img>
          </Grid>
        </Grid>
        <Grid container spacing={2} sx={{ marginTop: "100px" }}></Grid>

        <About />
        <Team />
      </React.Fragment>
      </div>

    </>
  );
}
